import React from 'react';
import Group37 from './Group37';
import Frame70 from './Frame70';

const Banner = () => {
  return (
    <div
      className="frame-container"
      style={{
        height: '500px',
        padding: '117px 188px',
        display: 'flex',
        flexDirection: 'column',
        gap: '10px',
        overflow: 'hidden',
        background: 'linear-gradient(90deg, #F23D31 0%, #D23429 100%)',
        position: 'relative',
      }}
    >
      <Frame70 />
      <Group37 />
      {/* Other banner content */}
    </div>
  );
};

export default Banner;
